import React from 'react';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import Footer from '../components/Footer';

const Profile = ({ userInfo, handleLogout }) => {

    // Update profile
    const [hardwareID, sethardwareID] = useState('');
    const [maxCurrent, setmaxCurrent] = useState('');
    const [gunCount, setgunCount] = useState('');
    const [connectivity, setconnectivity] = useState('');
    const [errorMessage, setErrorMessage] = useState('');

    const addProfileUpdate = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('http://192.168.1.70:9090/GetAllinputData', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ hardwareID, maxCurrent, gunCount, connectivity, chargerModel, currentPhase, maxPower, socketCount, chargerTag, chargerType, }),
            });
            alert(  JSON.stringify({ hardwareID, maxCurrent, gunCount, connectivity, chargerModel, currentPhase,
                maxPower, socketCount, chargerTag, chargerType }), 'add charger all data' );
            if (response.ok) {
                alert('Charger added successfully');
                // Clear the input after successful submission if needed
                sethardwareID(''); 
                setmaxCurrent(''); 
                setgunCount(''); 
                setconnectivity(''); 
                setchargerModel(''); 
                setcurrentPhase(''); 
                setmaxPower(''); 
                setsocketCount(''); 
                setchargerTag(''); 
                setchargerType(''); 

                setShowAddForm(false); // Close the form after successful addition
            } else {
                setErrorMessage('Failed to add charger');
            }
        }catch (error) {
                setErrorMessage('An error occurred while adding the charger');
                console.error('Error:', error);
        }
    };
    // Add Chargers end
    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout}/>
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Profile</h3>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div class="col-md-12 grid-margin stretch-card">
                                            <div class="card">
                                                <div class="card-body">
                                                    <form class="forms-sample" onSubmit={addProfileUpdate}>
                                                        <div class="form-group row">
                                                            <label for="exampleInputUsername2" class="col-sm-2 col-form-label">User Name</label>
                                                            <div class="col-sm-10">
                                                                <input type="text" class="form-control" id="exampleInputUsername2" placeholder="Username"/>
                                                            </div>
                                                        </div>
                                                        <div class="form-group row">
                                                            <label for="exampleInputEmail2" class="col-sm-2 col-form-label">Email</label>
                                                            <div class="col-sm-10">
                                                                <input type="email" class="form-control" id="exampleInputEmail2" placeholder="Email"/>
                                                            </div>
                                                        </div>
                                                        <div class="form-group row">
                                                            <label for="exampleInputMobile" class="col-sm-2 col-form-label">Mobile</label>
                                                            <div class="col-sm-10">
                                                                <input type="text" class="form-control" id="exampleInputMobile" placeholder="Mobile number"/>
                                                            </div>
                                                        </div>
                                                        <div class="form-group row">
                                                            <label for="exampleInputPassword2" class="col-sm-2 col-form-label">Password</label>
                                                            <div class="col-sm-10">
                                                                <input type="password" class="form-control" id="exampleInputPassword2" placeholder="Password"/>
                                                            </div>
                                                        </div>
                                                        <div style={{alignItems:'center'}}>
                                                            <button type="submit" class="btn btn-primary mr-2">Update</button>
                                                        </div>
                                                    </form>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    );
};   

export default Profile
